INSERT INTO `template_zzzsys_setup` VALUES ('1','NOT USED DELETED THIS FIELD',120,'Australia/Adelaide','','','','','',0,'','','','\r\n<script>\r\n\r\nfunction nuLoadEditGlobal(){\r\n\r\n	nuOnLoad();\r\n	\r\n}\r\n\r\n\r\nfunction nuLoadBrowseGlobal(){\r\n\r\n	nuOnLoad();\r\n	\r\n}\r\n\r\nfunction nuOnLoad() {                 //-- display a logo\r\n\r\n\r\n\r\n    if (window.top === window.self) {\r\n        var logoWidth = 129;\r\n        var logoLeft  = parseInt($(\'#nuActionButtonHolder\').css(\'width\')) - logoWidth - 10;\r\n        if (logoLeft > 500) {\r\n            var im        = document.createElement(\'img\');\r\n            im.setAttribute(\'id\', \'thislogo\');\r\n            im.setAttribute(\'src\', \'nuBuilder-Logo-medium.png\');\r\n            $(\'#nuActionButtonHolder\').append(im);\r\n            $(\'#\' + im.id).css( \'width\', logoWidth + \'px\');\r\n            $(\'#\' + im.id).css( \'height\', \'31px\');\r\n            $(\'#\' + im.id).css( \'left\',  logoLeft  + \'px\');\r\n            $(\'#\' + im.id).css( \'position\', \'absolute\');\r\n            $(\'#\' + im.id).css( \'border-style\', \'none\');\r\n            $(\'#\' + im.id).css( \'z-index\', \'0\');\r\n            $(\'#\' + im.id).css( \'top\', \'0px\');\r\n\r\n\r\n\r\n\r\n\r\n        }\r\n    } else {\r\n           if ( !window.parent.document.getElementById(\'nuDrag\') ) {\r\n               document.body.style.backgroundColor = \'#EDEDED\';\r\n           }      \r\n    }\r\n}\r\n\r\n</script>\r\n\r\n\r\n<style>\r\n\r\na:focus, \r\na:visited, \r\na:hover, \r\na:active                     {outline: thin dotted #333;outline: 5px auto -webkit-focus-ring-color;outline-offset: -2px;color: #202020;text-shadow: 0 1px 1px rgba(255, 255, 255, 0.75);text-decoration: none;}\r\n\r\ntable                        {padding:0px;margin:0px;text-align:center;vertical-align:top;margin-left:auto;margin-right:auto;width:100%;cellspacing:0px;cellpadding:0px}\r\ntr                           {padding:0px;margin